css:
.docker {
  display: flex;
}
.docker table.services {
  padding: 10px;
  display: block;
}
.docker table.services tr td {
  text-align: center;
}
.docker table.services tr td:first-of-type {
  text-align: left;
}
.docker table.services tr td:not(first-of-type) {
  padding: 0 .5em 1em 0;
}
.docker .title {
  margin: 10px;
}
.docker input[type="text"] {
  width: 100%;
  background: #181d23;
  color: #666d81;
  margin: 0px;
  outline: 0px;
  padding: 5px 12px;
  border: 0px;
  border-radius: 5px;
}
.docker input[type="text"]::-webkit-input-placeholder {
  color: #41505e;
}
.docker .compose-panel {
  display: flex;
  flex: 1;
  flex-direction: row;
  background-color: #181d23;
  max-height: 300px;
  height: 300px;
}
.docker .compose-control.text[type="button"] {
  background-color: #181d23;
  border: 1px solid #36904b;
  border-radius: 10%;
  color: #666d81;
  margin-right: 10px;
}
.docker .compose-control.text[type="button"]:hover {
  color: #36904b;
  border-color: #666d81;
}
.docker .compose-control.icon[type="button"] {
  border: 0px solid #36904b;
  padding-top: 5px;
  padding-bottom: 5px;
  border-radius: 10%;
  background-color: #181d23;
  color: #666d81;
}
.docker .compose-control.icon[type="button"]::before {
  margin-right: 0;
}
.docker .compose-control.icon[type="button"]:hover {
  color: #36904b;
}
.docker .compose-control[type="checkbox"] {
  -webkit-appearance: none;
  display: inline-block;
  position: relative;
  width: 1.5em;
  height: 1.5em;
  margin: 0 .5em 0 .5em;
  vertical-align: text-bottom;
  font-size: inherit;
  border-radius: 0px;
  background-color: #41505e;
  transition: background-color 0.16s cubic-bezier(0.5, 0.15, 0.2, 1);
  cursor: pointer;
}
.docker .compose-control[type="checkbox"]:focus {
  outline: 0;
  box-shadow: 0 0 0 1px #181d23;
}
.docker .compose-control[type="checkbox"]:active {
  background-color: #36904b;
}
.docker .compose-control[type="checkbox"]:before,
.docker .compose-control[type="checkbox"]:after {
  content: "";
  position: absolute;
  top: 1em;
  left: .6em;
  height: .125em;
  min-height: 2px;
  max-height: 5px;
  border-radius: 1px;
  background-color: #181d23;
  transform-origin: 0 0;
  opacity: 0;
  transition: transform 0.1s cubic-bezier(0.5, 0.15, 0.2, 1), opacity 0.1s cubic-bezier(0.5, 0.15, 0.2, 1);
}
.docker .compose-control[type="checkbox"]:before {
  width: .35em;
  transform: translate3d(0, 0, 0) rotate(225deg) scale(0);
}
.docker .compose-control[type="checkbox"]:after {
  width: .7em;
  margin: -1px;
  transform: translate3d(0, 0, 0) rotate(-45deg) scale(0);
  transition-delay: .05s;
}
.docker .compose-control[type="checkbox"]:checked {
  background-color: #36904b;
}
.docker .compose-control[type="checkbox"]:checked:active {
  background-color: #41505e;
}
.docker .compose-control[type="checkbox"]:checked:before {
  opacity: 1;
  transform: translate3d(0, 0, 0) rotate(225deg) scale(1);
  transition-delay: .05s;
}
.docker .compose-control[type="checkbox"]:checked:after {
  opacity: 1;
  transform: translate3d(0, 0, 0) rotate(-45deg) scale(1);
  transition-delay: 0;
}
.docker .compose-control[type="checkbox"]:indeterminate {
  background-color: #36904b;
}
.docker .compose-control[type="checkbox"]:indeterminate:active {
  background-color: #41505e;
}
.docker .compose-control[type="checkbox"]:indeterminate:after {
  opacity: 1;
  transform: translate3d(-0.125em, -0.25em, 0) rotate(0deg) scale(1);
  transition-delay: 0;
}
.docker .service-name {
  padding: 5px;
  width: 150px;
  color: #b7761e;
  cursor: default;
}
.docker .service-name.up {
  color: #36904b;
}
.docker .service-name.down {
  color: #a22537;
}
.docker .service-logs {
  background-color: #181d23;
  font-family: 'Ubuntu Mono', 'DejaVu Sans Mono', Menlo, Consolas, monospace;
  font-size: 12px;
  flex-shrink: 1;
}
